package leetcode.countVowels;

import java.util.HashSet;
import java.util.Set;

public class Solution {

    public static Set<Character> vowelSet = new HashSet<Character>() {{
        add('a');
        add('e');
        add('i');
        add('o');
        add('u');
    }};


    public static long countVowels(String word) {
        long time = System.currentTimeMillis();
        long res = 0;
        long n = word.length();
        for (int i = 0; i < n; ++i)
            if ("aeiou".indexOf(word.charAt(i)) >= 0)
                res += (i + 1) * (n - i);
        System.out.println("word.length" + word.length() + " cost:" + (System.currentTimeMillis() - time));
        return res;
    }

    public static void main(String[] args) {
        System.out.println(countVowels("aba"));
        System.out.println(countVowels("abc"));
        System.out.println(countVowels("ltcd"));
        System.out.println(countVowels("abbabca"));
        System.out.println(countVowels(""));
        System.out.println(countVowels(
                ""));
    }
}
